import React from 'react';
import './styles/Home.css';
import image97 from './Assets/image97.png'; 


const services = [
  { image: 'Img1', text: 'Истопатологические исследования' },
  { image: 'Img2', text: 'Пересмотр стекол' },
  { image: 'Img3', text: 'Цитологические исследования' },
  { image: 'Img4', text: 'Иммуногисто химические исследования' },
  { image: 'Img5', text: 'Генетические исследования' },
  { image: 'Img6', text: 'Ветеринария' }
];

function Home() {
  return (
    <div className="home">
      <div className="main-content">
        <div className="text-section">
          <h1>Патоморфологическая Лаборатория</h1>
          <p>Лаборатория оснащена новейшим оборудованием по стандартам США.</p>
          <div className="buttons">
            <button className="login-btn">Войти</button>
            <button className="register-btn">Зарегистрироваться</button>
          </div>
        </div>
        <div className="image-section">
          <img src={image97} alt="Lab Equipment" />
        </div>
      </div>
      <div className="home-container">
      <h1>Услуги</h1>
      <p>Наша лаборатория предлагает патологические исследования.</p>
      <div className="services-container">
        {services.map((service, index) => (
          <div key={index} className="service">
            <img src={require(`../Assets/${service.image}.PNG`)} alt={service.text} />
            <p>{service.text}</p>
          </div>
        ))}
      </div>
      <button>Увидеть все</button>
    </div>


    </div>
  );
}

export default Home;
